// Get data from named nodes
const proposal = $('Fetch Proposal').first().json;
const course = $('Fetch Course').first().json;

// Validate proposal data exists
if (!proposal || !proposal.id) {
  throw new Error('Fetch Proposal returned no data. Check if proposal exists.');
}

// Validate course data exists
if (!course || !course.id) {
  throw new Error('Fetch Course returned no data. Check if course exists.');
}

// Validate course has curriculum
if (!course.curriculumJson) {
  throw new Error('Course must have curriculum generated first');
}

if (!course.curriculumJson.sections || course.curriculumJson.sections.length === 0) {
  throw new Error('Curriculum must have sections');
}

// Return one item for each section
// This allows the Loop Sections node to process them
return course.curriculumJson.sections.map((section, index) => ({
  proposalId: proposal.id,
  courseId: course.id,
  courseTitle: course.title,
  courseDescription: course.description,
  courseLevel: course.level || 'INTERMEDIATE',
  curriculum: course.curriculumJson,
  totalSections: course.curriculumJson.sections.length,
  sectionIndex: index,
  section: section,
  generationStartTime: Date.now()
}));

// Get the item from Loop Sections
// Each item already has the section data from Validate & Prepare
const item = $input.first().json;

// The section is already extracted - just rename for clarity
return {
  proposalId: item.proposalId,
  courseId: item.courseId,
  courseTitle: item.courseTitle,
  courseDescription: item.courseDescription,
  courseLevel: item.courseLevel,
  totalSections: item.totalSections,
  sectionIndex: item.sectionIndex,
  currentSection: item.section,
  generationStartTime: item.generationStartTime
};

