const items = $input.all();
const baseData = items[0].json;
const contentResponse = items[0].json.content[0].text;
const quizResponse = items[1].json.content[0].text;

// Parse AI responses (handle markdown code blocks)
function parseJSON(text) {
  try {
    // Try direct parse first
    return JSON.parse(text);
  } catch (e) {
    // Extract from markdown code block
    const jsonMatch = text.match(/```json\s*([\s\S]*?)\s*```/) || 
                      text.match(/```\s*([\s\S]*?)\s*```/) ||
                      text.match(/\{[\s\S]*\}/);
    if (jsonMatch) {
      const jsonStr = jsonMatch[1] || jsonMatch[0];
      return JSON.parse(jsonStr);
    }
    throw new Error('Could not extract JSON from response');
  }
}

const content = parseJSON(contentResponse);
const quiz = parseJSON(quizResponse);

// Calculate costs (approximate based on Claude Sonnet 4 pricing)
// Input: $3/M tokens, Output: $15/M tokens
const contentCost = (items[0].json.usage?.input_tokens || 0) * 0.000003 + 
                     (items[0].json.usage?.output_tokens || 0) * 0.000015;
const quizCost = (items[1].json.usage?.input_tokens || 0) * 0.000003 + 
                  (items[1].json.usage?.output_tokens || 0) * 0.000015;

// Merge into extended section
const extendedSection = {
  // Original outline fields
  sectionNumber: baseData.currentSection.sectionNumber,
  title: baseData.currentSection.title,
  description: baseData.currentSection.description,
  learningObjectives: baseData.currentSection.learningObjectives,
  estimatedMinutes: baseData.currentSection.estimatedMinutes,
  topics: baseData.currentSection.topics,

  // NEW: Generated content
  content: {
    introduction: content.introduction,
    blocks: content.blocks,
    summary: content.summary,
    keyTakeaways: content.keyTakeaways
  },

  // NEW: Code examples (if any)
  codeExamples: content.codeExamples || [],

  // NEW: Quiz
  quiz: {
    questions: quiz.questions
  },

  // Metadata
  contentGeneratedAt: new Date().toISOString(),
  contentGenerationCostUsd: contentCost + quizCost
};

return {
  ...baseData,
  extendedSection,
  sectionGenerationCost: contentCost + quizCost
};

// Accumulate all extended sections
const items = $input.all();

if (!$node['Loop Sections'].context.noItemsLeft) {
  // Still looping - just pass through
  return items[0].json;
}

// All sections processed - assemble complete course
const baseData = items[0].json;
const extendedSections = [];
let totalGenerationCost = 0;

// Collect all extended sections
for (const item of items) {
  if (item.json.extendedSection) {
    extendedSections.push(item.json.extendedSection);
    totalGenerationCost += item.json.sectionGenerationCost || 0;
  }
}

// Build complete extended curriculum
const extendedCurriculum = {
  courseTitle: baseData.courseTitle,
  courseDescription: baseData.courseDescription,
  estimatedDuration: baseData.curriculum.estimatedDuration,
  level: baseData.courseLevel,
  sections: extendedSections,
  metadata: {
    totalSections: extendedSections.length,
    totalQuizQuestions: extendedSections.reduce((sum, s) => sum + s.quiz.questions.length, 0),
    generatedAt: new Date().toISOString(),
    generationCostUsd: totalGenerationCost,
    generationTimeSeconds: Math.round((Date.now() - baseData.generationStartTime) / 1000)
  }
};

return {
  proposalId: baseData.proposalId,
  courseId: baseData.courseId,
  extendedCurriculum,
  totalGenerationCost,
  generationTimeSeconds: Math.round((Date.now() - baseData.generationStartTime) / 1000)
};
